import styled from "styled-components";

const Login = (props) => {
    return (
        <Container>
            <Nav>
                <a href="/">
                    <img src="/images/tunein.svg" alt="" />
                </a>
                <div>
                    <Join>Join now</Join>
                </div>
            </Nav>
        </Container>
    )
};

const Container = styled.div`
    padding: 0px;
`;
const Nav = styled.nav`
    max-width: 2500px;
    margin: auto;
    padding: 12px 0 16px;
    display: flex;
    align-items: center;
    position: relative;
    justify-content: space-between;
    flex-wrap: nowrap;
    
    /* Style for the image */
    & > a {
        /* Adjust the width and height to your desired size */
        width: 234px; /* Adjust this value */
        height: 34px; /* Adjust this value */
        
        @media (max-width: 768px) {
            padding: 0 5px;
        } /* On a phone*/
    }
`;

const Join = styled.a`
    font-size: 16px;
    padding: 10px 12px;
    text-decoration: none;
`;

export default Login;
